import React from 'react';
import S from './Inf.module.css'
import Name from './Name/Name'
import About from './About/About'
const Profile = () => 
{
    return(
     
     <div className={S.inf}>
      <Name />
      <div className={S.about}>
<h1>Расскажите о себе</h1>
<About />
      </div>
     </div>
    )
}

export default Profile;
